import React from "react";
import Chart from "../components/Chart/Chart.jsx";
import { Grid } from "@material-ui/core";

import useStyles from './styles';



function Charts() {
  return (
    <div className="section">
      <h1>Charts</h1>
      <Grid
        container
        spacing={2}
        alignItems="center"
        justify="center"
        style={{ height: "60vh" }}
        maxWidth="80%"
      >
        <Grid item xs={12} sm={4}>
          <Chart title="Income" />
        </Grid>
        <Grid item xs={12} sm={4}>
          <Chart title="Saving" />
        </Grid>
        <Grid item xs={12} sm={4}>
          <Chart title="Expense" />
        </Grid>
      </Grid>
    </div>
  );
}

export default Charts;
